import React from 'react'
import "./SignIn.css";
import logo from "../img/logo2.png"

export default function SignIn() {
  return (
    <div className='signIn'>
        <div>
            <div className="loginForm">
            <img className="signUpLogo"  src={logo} alt="" />
            </div>
            <div></div>
        </div>
    </div>
  )
}
